import router from '@ohos.router'
import Constants from '../common/Constant'

@Entry
@Component
struct Index {
  build() {
    Column() {
      Text('电子相册').fontSize(28).margin(15).alignSelf(ItemAlign.Start).fontWeight(FontWeight.Bold)
      BannerContainer()
      Grid() {
        ForEach(Constants.IMG_ARR, (arrItem: Array<Resource>) => {
          GridItem() {
            PhotoItem({ arrItem })
          }.onClick(() => {
            router.pushUrl({ url: 'pages/PhotoList', params: {
              photoArr: arrItem
            } })
          })
        }, (_, index) => index.toString())
      }
      .columnsTemplate('1fr 1fr')
      .width('100%')
      .columnsGap(12)
      .rowsGap(12)
      .layoutWeight(1)
      .margin({ top: 20 })
    }.width('100%').padding(10)
  }
}

@Component
struct BannerContainer {
  build() {
    Row() {
      Swiper() {
        ForEach(Constants.BANNER_LIST, (item: Resource) => {
          Row() {
            Image(item).width('100%').height('100%')
          }.width('100%')
        }, (item, index) => JSON.stringify(item) + index.toString())
      }
      .autoPlay(true)
      .loop(true)
      .width('100%')
      .height('100%')
      .indicator(false)
      .borderRadius(10)
    }.width('100%').height(230)
  }
}

@Component
struct PhotoItem {
